import React from "react";
import {
  List,
  Datagrid,
  TextField,
  EditButton,
  DeleteButton,
  DateField,
  SingleFieldList,
  ChipField,
  ReferenceArrayField,
  ArrayField,
  FilterButton,
  TextInput,
  FilterForm,
  CreateButton,
  FilterList,
  FilterListItem,
} from "react-admin";
import { Box, Card, CardContent, styled } from "@mui/material";

const RegionFilter = () => {
  return (
    <FilterList label="Regions">
      <FilterListItem label="TX" value={{ region: "TX" }} />
      <FilterListItem label="LA" value={{ region: "LA" }} />
    </FilterList>
  );
};
const FilterSidebar = () => (
  <Box
    sx={{
      display: {
        xs: "none",
        sm: "block",
      },
      order: -1, // display on the left rather than on the right of the list
      width: "15em",
      marginRight: "1em",
      marginTop: "7.5em",
    }}
  >
    <Card>
      <CardContent>
        <RegionFilter />
      </CardContent>
    </Card>
  </Box>
);
const PlacesList = (props) => {
  return (
    <List {...props} aside={<FilterSidebar />}>
      <Datagrid rowClick="edit" width={"80%"}>
        <TextField source="regionId" label="Region" />
        <TextField source="placeId" label="Place id" />
        <TextField source="name" label="Place name" />
        <ArrayField source="newList" label="Printers">
          <SingleFieldList>
            <ChipField source="item" />
          </SingleFieldList>
        </ArrayField>
        <ArrayField source="employee" label="Employees">
          <SingleFieldList>
            <ChipField source="item" />
          </SingleFieldList>
        </ArrayField>
        <TextField source="latitude" label="Latitude" />
        <TextField source="longitude" label="Longitude" />
        <TextField source="radius" label="Radius" />
        <EditButton />
        {/* <EditButton basePath="/printers" />
        <DeleteButton basePath="/printers" /> */}
      </Datagrid>
    </List>
  );
};

export default PlacesList;
